<!doctype html>
<html lang="en" class="dark-theme">

<head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width,initial-scale=1" />
    <meta name="theme-color" content="#000000" />
    <meta name="description" content="StarfallEx Reference" />
    <title>SF Docs</title>
    <style>
        .dark-theme {
            scrollbar-color: dark
        }

        .dark-theme body {
            margin: 0;
            font-family: Roboto, -apple-system, BlinkMacSystemFont, "Segoe UI", Oxygen, Ubuntu, Cantarell, "Fira Sans", "Droid Sans", "Helvetica Neue", sans-serif;
            -webkit-font-smoothing: antialiased;
            -moz-osx-font-smoothing: grayscale;
            background-color: #333;
            color: #fff
        }

        .dark-theme body,
        .dark-theme html {
            margin: 0;
            padding: 0
        }

        .dark-theme code {
            font-family: source-code-pro, Menlo, Monaco, Consolas, "Courier New", monospace
        }

        .dark-theme .app {
            width: 100vw;
            height: 100vh;
            display: -webkit-flex;
            display: flex;
            -webkit-flex-direction: row;
            flex-direction: row
        }

        .dark-theme .card {
            font-size: .9em;
            position: relative
        }

        .dark-theme .card .card-children {
            margin-left: 10px
        }

        .dark-theme .card .card-title * {
            display: inline-block
        }

        .dark-theme .description {
            padding-left: 20px
        }

        .dark-theme .card-children .card {
            border-top: 1px solid #bbb
        }

        .dark-theme .sidebar {
            background-color: #262626;
            box-shadow: 2px 0 10px rgba(0, 0, 0, .6);
            display: -webkit-flex;
            display: flex;
            -webkit-flex-direction: column;
            flex-direction: column;
            -webkit-flex-basis: 20%;
            flex-basis: 20%;
            -webkit-align-items: stretch;
            align-items: stretch
        }

        .dark-theme .sidebar .sidebar-children {
            overflow-y: auto;
            -webkit-flex-grow: 1;
            flex-grow: 1;
            margin: 5px 20px
        }

        .dark-theme .sidebar .sidebar-children .sidebar-item-children {
            padding-left: 15px;
            margin-left: 6px;
            border-left: 1px solid #444
        }

        .dark-theme .sidebar .sidebar-children .name {
            color: #aaa;
            text-decoration: none
        }

        .dark-theme .sidebar .sidebar-children .name-selected {
            color: #fff
        }

        .dark-theme .sidebar .sidebar-children .sidebar-item-content {
            display: -webkit-flex;
            display: flex
        }

        .dark-theme .sidebar .sidebar-children .sidebar-item-content .name {
            cursor: pointer;
            -webkit-user-select: none;
            -ms-user-select: none;
            user-select: none
        }

        .dark-theme .sidebar .sidebar-children .sidebar-item-content .collapse-placeholder {
            margin-left: 2px;
            margin-right: 4px;
            width: 10px
        }

        .dark-theme .sidebar .sidebar-children .sidebar-item-content .collapse {
            font-weight: bolder;
            margin-left: 2px;
            margin-right: 4px;
            width: 10px;
            cursor: pointer;
            -webkit-user-select: none;
            -ms-user-select: none;
            user-select: none
        }

        .dark-theme .sidebar .version {
            background-color: #222;
            padding-bottom: 10px;
            padding-top: 5px;
            text-align: center;
            font-size: .8em
        }

        .dark-theme .sidebar .version .version-label {
            font-weight: bolder;
            display: block
        }

        .dark-theme .sidebar .version .version-text {
            display: block
        }

        .dark-theme .sidebar .version .updates-check {
            font-size: .9em;
            font-weight: 700;
            color: #bbb;
            display: block
        }

        .dark-theme .sidebar .search {
            border-top: 1px solid #bbb;
            border-bottom: 1px solid #bbb;
            margin: 0 20px;
            display: -webkit-flex;
            display: flex
        }

        .dark-theme .sidebar .search input {
            -webkit-flex-grow: 1;
            flex-grow: 1;
            margin: 10px 0;
            background-color: #1a1a1a;
            border: 1px solid #444;
            color: #fff
        }

        @media only screen and (max-width:1210px) {
            .dark-theme .sidebar .sidebar .logo {
                margin-top: 10px
            }

            .dark-theme .sidebar .sidebar .logo img {
                display: none
            }
        }

        .dark-theme .sidebar .logo {
            padding: 10px 0 20px;
            -webkit-align-items: center;
            align-items: center;
            -webkit-justify-content: center;
            justify-content: center;
            display: -webkit-flex;
            display: flex;
            -webkit-flex-direction: row;
            flex-direction: row
        }

        .dark-theme .sidebar .logo img {
            width: 48px;
            height: 48px;
            -webkit-filter: drop-shadow(3px 3px 3px #000);
            filter: drop-shadow(3px 3px 3px #000)
        }

        .dark-theme .sidebar .logo .text {
            display: block;
            font-size: 40px;
            text-shadow: 3px 3px 3px #000
        }

        .dark-theme .page {
            text-shadow: 1px 1px 2px #000;
            padding: 20px;
            -webkit-flex-grow: 1;
            flex-grow: 1;
            -webkit-flex-shrink: 1;
            flex-shrink: 1;
            min-width: 70%;
            max-width: 95%
        }

        .dark-theme .page-container {
            -webkit-flex-grow: 1;
            flex-grow: 1;
            display: -webkit-flex;
            display: flex;
            -webkit-flex-direction: column;
            flex-direction: column;
            -webkit-align-items: center;
            align-items: center;
            overflow-y: auto
        }

        .dark-theme .card-table table {
            border-collapse: collapse
        }

        .dark-theme .card-table td {
            padding: 5px
        }

        .dark-theme .card-table table,
        .dark-theme .card-table td {
            border: 1px solid #fff
        }

        .dark-theme .letter-icon {
            background: #333
        }

        .dark-theme .letter-icon,
        .dark-theme .realm-icon {
            width: 15px;
            height: 15px;
            margin-top: 3px;
            margin-right: 4px;
            border-radius: 10%;
            text-align: center;
            padding: 2px;
            line-height: 90%;
            color: #fff;
            text-shadow: #474747 1px 1px 1px;
            font-size: .9em;
            font-weight: 700
        }

        .dark-theme .realm-icon {
            min-width: 15px;
            -webkit-flex-shrink: 0;
            flex-shrink: 0
        }

        .dark-theme .realm-icon-client {
            background: linear-gradient(45deg, #dea909 50%, #dea909 50.001%)
        }

        .dark-theme .realm-icon-server {
            background: linear-gradient(45deg, #03a9f4 50%, #03a9f4 50.001%)
        }

        .dark-theme .realm-icon-shared {
            background: linear-gradient(45deg, #03a9f4 50%, #dea909 50.001%)
        }

        .dark-theme .click-action {
            cursor: pointer
        }

        .dark-theme .accept-newlines {
            white-space: pre-line
        }

        .dark-theme .sf-src {
            color: #fff;
            font-weight: 700;
            float: right;
            text-align: right;
            font-size: 15px;
            top: 10px;
            right: 10px;
            position: absolute
        }

        .dark-theme .sf-reference {
            color: #059de3;
            font-weight: 700;
            text-decoration: none
        }

        .dark-theme .sf-paramname {
            font-weight: 700
        }

        .dark-theme .card-contributors {
            padding-left: 60px
        }

        .dark-theme .card-contributors li {
            list-style-type: none;
            margin-bottom: 5px;
            line-height: 24px;
            margin-left: 0;
            padding-left: 0
        }

        .dark-theme .card-contributors ul {
            margin-left: 0;
            padding-left: 20px
        }

        .dark-theme .card-contributors .name {
            font-size: 20px
        }

        .dark-theme .card-contributors .avatar {
            background-color: #fff;
            border-radius: 2px;
            margin-right: 5px;
            vertical-align: top;
            display: inline-block;
            width: 24px;
            height: 24px
        }

        .dark-theme .pad-left-10 {
            padding-left: 10px
        }
    </style>
</head>

<body><noscript>You need to enable JavaScript to run this app.</noscript>
